package de.wwu.sdpn.tests.core

import de.wwu.sdpn.core.ta.xsb.witness.iterable.WitnessTree

object ManualWitnessParsing extends App {

    def parser = de.wwu.sdpn.core.ta.xsb.witness.iterable.AbstractFullWitnessParser

    var pTrees : Set[WitnessTree] = Set()
    
    for (tree <- trees) {
        val res = parser.parseTree(tree)
        assert(res.successful, res)
        println(res.get.printTreeStates)
        pTrees += res.get
        println()
    }
    
    println("Total: " + pTrees.size)
    
    val qTrees = quotient(pTrees,WitnessTree.equalModStates)
    
    println("Quotient: " + pTrees.size)

    def quotient[T](ls: Set[T], fun: (T, T) => Boolean): Set[T] = {
        var r = Set[T]()
        for (t <- ls)
            if (!r.exists(e => fun(t, e)))
                r += t
        r
    }

